import React, {useState,useMemo} from "react"
import Modal from "../Modal"
import { useParams } from "react-router-dom"
import {getBinanceExchanges,getBitfinexExchanges,getHuobiExchanges,getKrakenExchanges} from '../../services/exchanges'

type ResultsTableProps = { //TODO move to types
    binanceData:number
    bitfinexData:number
    huobiData:number
    krakenData:number
    pair: string
}

const ResultsTable = function(props:ResultsTableProps){
    const {binanceData,bitfinexData,krakenData,huobiData, pair} = props
    const [sortConfig, setSortConfig] = useState({direction:""});
    const [popupVisible, setPopupVisible] = useState(false);
    const [popupData, setPopupData] = useState<any>({})
    const params = useParams()
    const pathpair = params.pair
    
    const logos:any = {
        "Binance" : "data:image/svg+xml;base64,",
        "Bitfinex": "data:image/svg+xml;base64,",
        "Kraken": "data:image/svg+xml;base64,",
        "Huobi": "data:image/svg+xml;base64,",
    } 

    let initialData = [
        {"platform": "Binance", "price": binanceData},
        {"platform": "Bitfinex", "price": bitfinexData},
        {"platform": "Huobi", "price": huobiData},
        {"platform": "Kraken", "price": krakenData},
    ]

    React.useMemo(()=>{
        
        initialData.sort((a,b)=>{
        if(a.price < b.price){
            return sortConfig.direction === 'ascending' ? -1 : 1;
        }
        if(a.price > b.price){
            return sortConfig.direction === 'ascending' ? 1 : -1;
        }
            return 0
        })
        return initialData
    },[binanceData,bitfinexData,huobiData,krakenData,sortConfig])

    const buildClassName = () =>{
        if (!sortConfig) {
            return;
        }
        return sortConfig.direction ? sortConfig.direction : undefined;
    }
    
    const sort = () => {
        let direction = 'ascending';
        if (sortConfig.direction === 'ascending') {
            direction = 'descending';
        }
        setSortConfig({ direction });
    }

    const handlePriceButtonClick = (platform:"Binance"|"Bitfinex"|"Huobi"|"Kraken") =>{
        let searchString = pair.replace("/","")
        if(searchString === ""){
            searchString = pathpair || ""
        }
        let queries = {
            "Binance":{"symbol": searchString.toUpperCase(), "limit": "15"},
            "Bitfinex":{"limit":  "15"},
            "Huobi":{"symbol": searchString.toLowerCase(),"size": "15"},
            "Kraken":{"pair": searchString.toUpperCase()}
        }
        let paths = {
            "Binance":"/trades",
            "Bitfinex":`/v2/trades/t${searchString.toUpperCase()}/hist`,
            "Huobi":"/history/trade",
            "Kraken":"/0/public/Trades" //returns last 1000 trades no limit
        }
        
        let query = queries[platform]
        let path = paths[platform]
        

        if(platform==="Binance"){ //TODO catch the case when failing
            getBinanceExchanges(path,query).then((res)=>{
                let identifier = {key:"Binance",data:res}
                setPopupData(identifier) ;
                setPopupVisible(true);
            })
        }else if(platform==="Bitfinex"){
            getBitfinexExchanges(path,query).then((res)=>{
                let identifier = {key:"Bitfinex",data:res}
                setPopupData(identifier) ;
                setPopupVisible(true);
            })
        }else if (platform==="Huobi"){
            getHuobiExchanges(path,query).then((res:any)=>{
                let data = []
                for( let item of res.data){
                    data.push(item.data[0])
                }
                let identifier = {key:"Huobi",data:data}
                setPopupData(identifier) ;
                setPopupVisible(true);
            })
        }else{
            getKrakenExchanges(path,query).then((res:any)=>{
                if(res.error.length === 0){
                    let last15 = res.result[Object.keys(res.result)[0]].slice(0,15)
                    let identifier = {key:"Kraken",data:last15}
                    setPopupData(identifier) ;
                    setPopupVisible(true);
                }else {
                    //todo show popup with error msg
                }
            })
        }
    }
    return (
        <>
            <table className="results-table">
                <thead>
                    <tr className="results-table-row">
                        <th>Platform</th>
                        <th className={buildClassName()} onClick={()=> {sort()}}>Price</th> 
                    </tr>
                </thead>
                <tbody>
                {
                    initialData.map((item, key)=> {
                        return (
                            <tr key={key} className="results-table-row">
                                <td>
                                    <div className="flex">
                                        <div className="image"><img className={item.platform.toLowerCase()} src={logos[item.platform]}/></div>
                                        <div className="text">{item.platform}</div>
                                    </div>
                                </td>
                                <td><button className="results-table-button" id={item.platform} onClick={(e)=>{
                                    //@ts-ignore
                                    handlePriceButtonClick(e.currentTarget.id)
                                }}>{item.price === -404 ? "Invalid Symbol": item.price=== -1 ? "Search for a pair to get data": item.price}</button></td>
                            </tr>
                        )
                    })
                }
                </tbody>
            </table>
            <div className="criptocurrency">
                <img src='data:image/svg+xml;base64,'/>
            </div>
            <Modal popupData={popupData} title={"Details"} onClose={() => {
              setPopupVisible(false)
            }} visible={popupVisible}/>
        </>
    )
}

export default ResultsTable